import React from 'react'
import Country from './Country'

const CountriesDisplay = ({countries}) => {

  
  return (
    <div>
      {countries.map((country) => <Country key={country.name.common} name={country.name.common}/>)}       
    </div>
  )
}


export default CountriesDisplay
